import React from 'react';
import Head from './Head';
import {Helmet} from 'react-helmet'

const Home = () => {
  return (
    <div>
      <Helmet>
        <title> React | Home</title>
        <meta name="description" content="Está é a página sobre" />
      </Helmet>
      <h1>Home</h1>
      <p>Essa é a Home</p>
    </div>
  );
};

export default Home;
